import React from 'react';
import { motion } from 'framer-motion';
import { Github, Linkedin, Mail, Award, Users, Target } from 'lucide-react';

const About = () => {
  const teamMembers = [
    {
      name: "Neha Tapasvi",
      role: "Project Lead & AI Researcher",
      rollNo: "XX",
      image: "https://images.unsplash.com/photo-1494790108755-2616b612b786?w=150&h=150&fit=crop&crop=face",
      github: "https://github.com/neha123",
      linkedin: "https://linkedin.com/in/neha-tapasvi",
      email: "neha@dtaad.com",
      bio: "Leading the DTAAD research initiative with expertise in deep learning and time series analysis. Passionate about developing efficient AI solutions for real-world problems."
    },
    {
      name: "Dr. Sarah Chen",
      role: "Technical Advisor",
      rollNo: "Advisor",
      image: "https://images.unsplash.com/photo-1573496359142-b8d87734a5a2?w=150&h=150&fit=crop&crop=face",
      github: "https://github.com/sarahchen",
      linkedin: "https://linkedin.com/in/sarah-chen",
      email: "sarah@dtaad.com",
      bio: "PhD in Computer Science with 10+ years of experience in machine learning research. Guiding the technical direction and methodology of the DTAAD project."
    },
    {
      name: "Alex Rodriguez",
      role: "Senior Developer",
      rollNo: "XX",
      image: "https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?w=150&h=150&fit=crop&crop=face",
      github: "https://github.com/alexrod",
      linkedin: "https://linkedin.com/in/alex-rodriguez",
      email: "alex@dtaad.com",
      bio: "Full-stack developer specializing in scalable AI systems. Responsible for implementing the DTAAD architecture and ensuring optimal performance."
    },
    {
      name: "Maria Santos",
      role: "Data Scientist",
      rollNo: "XX",
      image: "https://images.unsplash.com/photo-1438761681033-6461ffad8d80?w=150&h=150&fit=crop&crop=face",
      github: "https://github.com/mariasantos",
      linkedin: "https://linkedin.com/in/maria-santos",
      email: "maria@dtaad.com",
      bio: "Expert in time series analysis and statistical modeling. Developing evaluation metrics and conducting comprehensive performance analysis for DTAAD."
    }
  ];

  const achievements = [
    {
      icon: Award,
      title: "Research Excellence",
      description: "Published in top-tier AI conferences and journals",
      color: "cyan"
    },
    {
      icon: Users,
      title: "Collaborative Team",
      description: "Interdisciplinary team of AI researchers and engineers",
      color: "purple"
    },
    {
      icon: Target,
      title: "Industry Impact",
      description: "Real-world applications in anomaly detection systems",
      color: "cyan"
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
        delayChildren: 0.2,
      }
    }
  };

  const itemVariants = {
    hidden: { y: 50, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        type: 'spring',
        stiffness: 100,
        damping: 12
      }
    }
  };

  return (
    <div className="min-h-screen pt-20 pb-10">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h1 className="text-4xl md:text-6xl font-bold gradient-text mb-6">
            About DTAAD
          </h1>
          <p className="text-xl text-gray-400 max-w-3xl mx-auto leading-relaxed">
            Meet the innovative team behind DTAAD - Dual TCN-Attention Networks for Anomaly Detection in Multivariate Time Series Data
          </p>
        </motion.div>

        {/* Project Overview */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
          className="glass p-8 rounded-2xl border border-white/10 mb-16"
        >
          <div className="grid md:grid-cols-2 gap-8 items-center">
            <div>
              <h2 className="text-3xl font-bold gradient-text mb-6">
                Our Mission
              </h2>
              <p className="text-lg text-gray-400 leading-relaxed mb-6">
                DTAAD represents a breakthrough in time series anomaly detection through the innovative 
                combination of Temporal Convolutional Networks (TCN) and attention mechanisms. Our goal 
                is to provide a lightweight, efficient, and highly accurate solution for real-time anomaly 
                detection across various industries.
              </p>
              <div className="flex flex-wrap gap-4">
